window.bookSummaryJSON = "<p><b>When powers clash.</b></p> <p>In the mafia world, women don’t reign.</p> <p>I’m the exception of that rule.</p> <p>I didn’t choose this life. It chose me.</p> <p>I have a legacy to protect, a power to snatch, and no one will stop me.</p> <p>If an arranged marriage is what it’ll take to lead, then so be it.</p> <p>What I don’t count on is that my chosen husband happens to be a ghost from my past.</p> <p>Kyle Hunter.</p> <p>He was once my guard, my protector. Now, he’s after my kingdom.</p> <p>The road to the throne is paved with thorns, blood, and casualties.</p> <p>To win, I’ll risk it all. </p> <p>My heart included.</p> <p><i>Throne of Power </i>is the first part of a duet and is not a stand-alone.</p>"; 
